	<view class="navigation-bar">
		<!-- <view class="navigation-bg" :style="{height:'25%'}"></view> -->
		<view class="navigation-bar-fixed" :style="{'padding-top':marginTop,background:(!config.transparent&&!config.linear)?config.bgcolor:'transparent'}">
			<!-- capsule or normal -->
			<!-- title -->
			<view v-if="types == 'index'">
				<view class="navigation-bar-title" :style="'color:'+config.fontcolor"><text>JOOM</text><text>XP</text></view>
				<view v-if="xina" class="search-fixed-sea"></view>
				<!-- linear background -->
				
