<script>
	export default {
		data() {
			return {
				h3: 0,
				bgH: 0,
				clsiw: 0,
				xina: false,
				w_jn: 0,
				ijia: 0,
				searH: 0,
				swiList: [],
				iconList: [{
						className: 'icon-dianpu',
						id: '1'
					},
					{
						className: 'icon-aixin',
						id: '2'
					},
					{
						className: 'icon-pinglun',
						id: '3'
					},
				]
			};
		},
		computed: {
			height() {
				const {
					platform,
					statusBarHeight
				} = uni.getSystemInfoSync()
				let height = statusBarHeight + 4 //ios 24px
				if (platform.toLowerCase() == "android") {
					height += 4 //android 28px
				}
				// 胶囊高度 32px 下边框6px height 状态栏高度
				return height + 38 + "px"
			},
			tops() {
				var top = 0
				uni.getSystemInfo({
					success: function (res) {
						// console.log(res)
						top = res.safeAreaInsets.top + 14
					}
				});
				// 胶囊高度 32px 下边框6px height 状态栏高度
				return top + "px"
			},
			marginTop() {
				const {
					platform,
					statusBarHeight
				} = uni.getSystemInfoSync()
				let height = statusBarHeight + 4
				if (platform.toLowerCase() == "android") {
					height += 4
				}
							// console.log(height)
				return height + "px"
			}
		},
		created() {
			// uni.getSystemInfo({
			// 	success: function (res) {
			// 		console.log(res)
			// 	}
			// });
		},
		mounted() {
			// console.log(this.config)
			var that = this
			if (this.types == 'index') {
				uni.createSelectorQuery().in(that).select('.search').boundingClientRect(data => {
					that.$emit('movesH', data,that.marginTop)
				}).exec()
			}
		},
		props: {
			config: {
				type: Object,
				default () {}
			},
			scrollTop: {
				type: Number,
				default: 0
			},
			PageScroll: {
				type: Object,
				default () {}
			},
			scrollMaxHeight: {
				type: Number,
				default: 288
			},
			swiperList: {
				type: Array,
				default: []
			},
			types:{
				type:String,
				default:''
			}
		},
		watch: {
			swiperList: {
				handler(newVal, oldVal) {
					// var that = this
					// var h = parseInt(that.height.split('px')[0])
					// var h2
					this.swiList = newVal
				},
				deep: true
			},
			PageScroll: {
				handler(newVal, oldVal) {
					// #ifdef MP-WEIXIN
					let menuButtonInfo = uni.getMenuButtonBoundingClientRect()
					// console.log(menuButtonInfo.height)
					// console.log(newVal.scrollTop)

					if (parseInt(menuButtonInfo.height) <= parseInt(newVal.scrollTop)) {
						this.w_jn = 0
						this.xina = true
						this.w_jn = parseInt(menuButtonInfo.width) + 40
					} else {
						this.xina = false
						this.w_jn = 0
					}
					// #endif

					// #ifndef MP-WEIXIN
					let that = this
					let h = 0
					var icon_three = 0
					uni.createSelectorQuery().in(that).select('.navigation-bar-title').boundingClientRect(data => {
						h = parseInt(that.marginTop.split('px')[0]) + data.height
						if (h <= newVal.scrollTop) {
							that.w_jn = 240
							that.xina = true
						} else {
							that.w_jn = 0
							that.xina = false
						}
					}).exec()
					// #endif
				},
				deep: true
			}
		},
		methods: {
			hights(val) {
				this.$emit('hights', this.h3)
			},
			back_() {
				uni.navigateBack({
					delta: 1
				});
			},
			home_() {
				uni.switchTab({
					url: "/pages/index/index"
				})
			},
			conduct_() {
				this.$emit("customConduct")
			}
		}
	}
</script>

